async () => {
  let IP = await JSObject_Method.GetUserIP();
  let TimeStamp = await JSObject_Method.TimeStamp();
  let Name = await InputName.text;
  let Level = await Select_Level.selectedOptionValue;
  let Odo = await InputOdometer.text;
  let Title = await InputTitle.text;
  let Trophy = await InputRgTropy.text;
  let PlateNum = await InputPlateNumber.text;
  let Area = await SelectRegionId.selectedOptionValue;
  let OtherColor = await InputCustomColor.text;
  let Wheel = await Select_Wheel.selectedOptionValue;
  await storeValue("Logs", {
    "IPAdress": IP,
    "TimeStamp": TimeStamp,
    "Name": Name,
    "Level": Level,
    "Odo": Odo,
    "Title": Title,
    "Trophy": Trophy,
    "PlateNum": PlateNum,
    "Area": Area,
    "OtherColor": OtherColor,
    "Wheel": Wheel
  }, false);
  await Insert_Car_Edited_Logs.run();
}

